import React from "react";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import "../../styles/index.css";

const CustomNavbar = () => {
  const onButtonPress = () => {};
  return (
    <div>
      <Navbar collapseOnSelect expand="md" bg="dark" variant="dark">
        <Navbar.Brand style={{ cursor: "pointer" }}>
          Lightweight Blockchain
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="ml-auto ">
            <button
              className="btn btn-primary"
              value="Payload List"
              onClick={(e) => onButtonPress(e.target.value)}
            >
              Payload List
              <a href="/payloadlist" className="info-secondary"></a>
            </button>
            <a href="/writerlist" className="link-secondary">
              {" "}
              Writer List
            </a>
            <a href="/blocklist" className="link-secondary">
              {" "}
              Block List
            </a>
            <a href="/nodeSystem" className="link-secondary">
              {" "}
              Node system
            </a>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </div>
  );
};

export default CustomNavbar;
